body.text:
{
    "name": "Phylolib",
    "description": "A library of efficient algorithms for phylogenetic analysis",
    "api": {
        "url": "api's url",
        "endpoints": [
            {
                "name": "",
                "description": "",
                "url": "",
                "method": "",
                "headers": {},
                "body": {}
            }
        ]
    },
    "library": {
        "callCommand": "phylolib",
        "arguments": [
            { 
                "name": "help",
                "areOptionsAllowed": false
            },
            {
                "name": "distance",
                "areOptionsAllowed": true,
                "allowedCommands": [
                    "hamming",
                    "grapetree",
                    "kimura"
                ]                
            },
            {
                "name": "correction",
                "areOptionsAllowed": true,
                "allowedCommands": [
                    "jukescantor"
                ]
            },
            {
                "name": "algorithm",
                "areOptionsAllowed": true,
                "allowedCommands": [
                    "goeburst",
                    "edmonds",
                    "sl",
                    "cl",
                    "upgma",
                    "upgmc",
                    "wpgma",
                    "wpgmc",
                    "saitounei",
                    "studierkepler",
                    "unj"
                ]
            },
            {
                "name": "optimization",
                "areOptionsAllowed": true,
                "allowedCommands": [
                    "lbr"
                ]
            }
        ],
        "options": [
            {
                "name": "File Output",
                "argument": "-o",
                "alias": [
                    "--out"
                ],
                "valueType": "String"
            },
            {
                "name": "Dataset Input",
                "argument": "-d",
                "alias": [
                    "--dataset"
                ],
                "valueType": "String"
            },
            {
                "name": "Distance Matrix Input",
                "argument": "-m",
                "alias": [
                    "--matrix"
                ],
                "valueType": "String"
            },
            {
                "name": "Limit of focus variants",
                "argument": "-l",
                "alias": [
                    "--lvs"
                ],
                "valueType": "Number"
            }
        ]
    }
}
